import React, {Component} from 'react';
import DisplayCards from './components/display-cards/display-cards.js';
import Footer from './components/footer/footer.js';
import Hero from './components/hero/hero.js';
import MobileNav from './components/mobile-navbar/mobile-navbar.js';
import Nav from './components/navbar/navbar.js';

import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';


class App extends Component {
    render() {
    return (
      <div>
        <Nav />
        <MobileNav />
        <Hero />
        <div className="card-container">
          <DisplayCards />    
        </div>
        <Footer />
          <div>
            <button onclick="i18next.changeLanguage('en')">
              english
            </button>
            <button onclick="i18next.changeLanguage('de')">
              german
            </button>
            <div id="output" />
          </div>
      </div>
    );
  } 
}


export default App;
